    false,nt"url": null,nt"notes": "This amendment to the 1982 Don Edwards
    San Francisco Bay NWR waterfowl hunting plan was written to address 5,500 acres
    of salt pond recently acquisitioned by the refuge.  This amendment opens approximately
    2,622 of those acres to waterfowl hunting. Waterfowl hunting of Salt Ponds A5, A7
    and A8N will be permitted on Saturdays, Sundays and Wednesdays on a walk in basis.
     Ponds AB1, A2E, AB2, A3N, and A3W will also be opened for hunting as described
    above except access will be restricted to use of motor vehicles driven to the small
    private boats in the ponds and hunting will only be allowed from existing blinds
    in the ponds.  This plan is not expected to affect threatened and endangered species
    found on the refuge.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
